import React from 'react';
import Navbar from '../components/Navbar';
import Jumbotron from '../components/Jumbotron';
import Card from '../components/Card';

function Books() {
    return(
        <Navbar>
            <Jumbotron>Search for a book!</Jumbotron>
            <Card></Card>
        </Navbar>
    )
}

export default Books;
